import { Button } from 'react-bootstrap';
import React from 'react';

const Todo = ({ todo }) => {
  const { id, title, desc } = todo;  
  return (
    <div>
      <article>
        <div>
          <b>{todo.id}</b>
          <h3>{todo.title}</h3>
          <p>{todo.desc}</p>
        </div>
        <div>
          <Button> {/* Button component from react-bootstrap */}
            {/* Button content */}
          </Button>
        </div>
      </article>
    </div>
  );
}

export default Todo;
